import React, { useState, useEffect } from "react";
import Dialog from "@material-ui/core/Dialog";
import DialogContent from "@material-ui/core/DialogContent";
import DialogTitle from "@material-ui/core/DialogTitle";
import config from "../config";
const chimeraContract = require("../contracts/Chimera.json");
const SMAV2Contract = require("../contracts/ChimeraMarketAuctionV2.json");
let web3;
let accounts;
let chimera;
let SMAV2;

function dialoguePopUp(props) {
  const [open, setOpen] = useState(false);
  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <button
        onClick={handleClickOpen}
        className="btn btn-primary"
        style={{
          fontSize: "12px",
        }}
      >
        Set SalePrice
      </button>
      <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">{"Which One?"}</DialogTitle>
        <DialogContent className="text-center mb-5">
          <div className="px-5">
            <a
              href="/create-digitalart"
              className="md:mr-5 lg:mr-5  xl:mr-5 sm:mr-0"
            >
              <button
                className="btn btn-primary text-center mt-2"
                style={{
                  borderRadius: "30px",
                  height: 360,
                  width: 203,
                  backgroundColor: "white",
                  color: "black",
                  borderColor: "#D8D8D8",
                }}
              >
                <img
                  src="https://rarible.com/static/2a78e39400f51f1dbeba13832f421092.png"
                  width="150px"
                  className="rounded shadow-2xl ml-3 mt-4 mb-4"
                />
                <span className="font-bold font-Lobster text-xl">Digital</span>
              </button>
            </a>
            <a href="/create-physicalart">
              <button
                className="btn btn-primary mt-2"
                style={{
                  borderRadius: "30px",
                  height: 360,
                  width: 203,
                  backgroundColor: "white",
                  color: "black",
                  borderColor: "#D8D8D8",
                }}
              >
                <img
                  src="https://rarible.com/static/48dc30c106da96755b60ead8627c8888.png"
                  width="155px"
                  className="rounded shadow-2xl ml-3 mt-4 mb-4"
                />
                <span className="font-bold font-Lobster text-xl">Physical</span>
              </button>
            </a>
          </div>
        </DialogContent>
      </Dialog>
    </div>
  );
}
export default dialoguePopUp;
